Insert into TBLFAQ (FAQSEQ,FAQTITLE,FAQCONTENT,FAQWRITEDATE) values (faqSeq.nextVal,'회원가입은 어떻게 하나요?','자랑이 사이트는 회원 콘텐츠 서비스를 모두 무료로 제공하고 있습니다. 회원이 되시면 자격증정보 뿐만아니라 커뮤니티, 자랑이톡, 자격증 추천, 우리동네학원 등의 다양한 서비스를 무료로 체험하실 수 있습니다. ? 자랑이 회원가입 방법 회원가입은 아래의 링크를 통해 진행하실 수 있습니다. 아래의 내용을 참고하여 하단의 링크를 통해 회원가입을 진행해주세요. 자랑이 회원가입 바로가기',to_date('22/08/15','RR/MM/DD'));
Insert into TBLFAQ (FAQSEQ,FAQTITLE,FAQCONTENT,FAQWRITEDATE) values (faqSeq.nextVal,'휴대폰 인증 문자가 오지 않는데 어떻게 해야 하나요?','문자 수신이 안될 경우에는 아래 두 가지 사항을 확인해주세요. 1. 휴대폰 재부팅 문자 수신 문제는 통신사와 디바이스간 연결에 문제가 있을 수 있습니다.  휴대폰 재부팅을 진행하시면 문자 수신이 정상화 되는 경우도 있으니 우선 휴대폰 재부팅 먼저 진행해주시기 바랍니다.  2. 스팸차단 설정 확인 인증 문자가 수신되지 않는다면 인증 문자 발송 번호가 스팸번호로 등록되어 있지 않은지 확인해주시길 바랍니다.',to_date('22/08/15','RR/MM/DD'));
Insert into TBLFAQ (FAQSEQ,FAQTITLE,FAQCONTENT,FAQWRITEDATE) values (faqSeq.nextVal,'로그인이 안돼요. 어떻게 하나요?','1. 이메일 계정 메일 계정을 올바르게 입력하셨는지 다시 한번 확인해주시기 바랍니다. 참고 : 가입하지 않은 경우 회원가입 을 클릭하여 회원가입을 해주시기 바랍니다. 이외 메일 계정이 잘못되지 않은 경우에도 로그인이 되지 않는다면  고객지원팀으로 문의 해주시기 바랍니다. 2. 비밀번호 비밀번호를 올바르게 입력하셨는지 다시 한번 확인해주시기 바랍니다. ',to_date('22/08/15','RR/MM/DD'));
Insert into TBLFAQ (FAQSEQ,FAQTITLE,FAQCONTENT,FAQWRITEDATE) values (faqSeq.nextVal,'이름을 개명하였는데 어떻게 하나요?','회원가입 후 실명인증을 하지 않은 경우라면, 실명인증을 통하여 개명 후 이름을 변경하실 수 있으며, 실명인증을 한 경우라면, 이름변경 버튼을 클릭하시어 다시 실명인증을 해주시면 개명 후 이름으로 변경하실 수 있습니다. 단, 회원님의 개명 후 이름이 신용평가기관에 등록되어 있는 경우, 즉시 이름이 변경됩니다. 신용평가기관에 아직 등록이 되지 않았다면 아래 사이트를 참고하여 등록 후 변경 가능합니다. <신용평가기관> ▶ NICE신용평가정보㈜ ▶ 서울신용평가정보㈜ ▶ 코리아크레딧뷰로㈜',to_date('22/08/15','RR/MM/DD'));
Insert into TBLFAQ (FAQSEQ,FAQTITLE,FAQCONTENT,FAQWRITEDATE) values (faqSeq.nextVal,'아이디와 비밀번호를 분실하였습니다. 어떻게 하나요?','아이디와 비밀번호를 분실 하였을 경우 로그인을 클릭하신 후 하단의 아이디/비밀번호 찾기를 이용하시면 됩니다. 이름과 등록하신 이메일주소 또는 이름과 등록하신 휴대폰 번호를 입력하시면 찾으실 수 있습니다.',to_date('22/08/15','RR/MM/DD'));
Insert into TBLFAQ (FAQSEQ,FAQTITLE,FAQCONTENT,FAQWRITEDATE) values (faqSeq.nextVal,'비방/비하, 명예훼손 등을 당했어요.','비방/비하, 명예훼손 등을 당했어요.신고를 통해 명예훼손 등의 신고를 진행할 수 있습니다. 자랑이 서비스에 등록된 게시물,댓글 중 비방/비하, 명예훼손 등 문제 되는 게시물, 댓글 신고 버튼을 눌러주세요.',to_date('22/08/15','RR/MM/DD'));
