INSERT INTO TBLNOTICEBOARD (NOTICEBOARDSEQ, NOTICEBOARDTITLE, NOTICEBOARDCONTENT, ADMININFOID, NOTICEBOARDWRITEDATE, NOTICEBOARDLIKE, NOTICEBOARDHITS) VALUES (noticeBoardSeq.nextVal,'자랑이 커뮤니티는 바른 말 쓰기를 권유합니다.','자넷 커뮤니티에서는 바른 말, 예쁜 말 쓰기를 권유합니다. 타인을 비방하거나, 욕설 및 광고성 게시글과 댓글은 작성자의 사전 동의 없이 관리자가 직접 삭제할 수 있습니다. 또한 회원 간의 분쟁이나 욕설로 인한 댓글 논쟁은 쌍방 처벌이 될 수 있음을 알려드리며 권리 침해 및 명예훼손 게시물은 자넷 "신고센터"를 이용하여 게시물 신고를 요청해 주시기 바랍니다.','admin1',to_date('2023-06-22', 'RRRR-MM-DD'),453,5463);
INSERT INTO TBLNOTICEBOARD (NOTICEBOARDSEQ, NOTICEBOARDTITLE, NOTICEBOARDCONTENT, ADMININFOID, NOTICEBOARDWRITEDATE, NOTICEBOARDLIKE, NOTICEBOARDHITS) VALUES (noticeBoardSeq.nextVal,'자넷 홈페이지 서버 정기점검 공지','자랑이 홈페이지 서비스 안정화를 위한 서버 정기점검 안내입니다.더욱 안정적인 서비스 제공을 위하여 아래와 같이 서버 정기점검이 진행됨을 알려드립니다.점검 일정 : 2022년 2월 21일 00:00 ~ 04:00까지점검 기간 동안 회원가입, 마이페이지 등 서비스 운영이 제한되오니 많은 양해 부탁 드립니다.감사합니다.','admin2',to_date('2023-07-13', 'RRRR-MM-DD'),765,7437);
INSERT INTO TBLNOTICEBOARD (NOTICEBOARDSEQ, NOTICEBOARDTITLE, NOTICEBOARDCONTENT, ADMININFOID, NOTICEBOARDWRITEDATE, NOTICEBOARDLIKE, NOTICEBOARDHITS) VALUES (noticeBoardSeq.nextVal,'자랑이 교육·학원 서비스 오픈 공지','맞춤형 교육기관 찾기 힘드셨죠? 자랑이가 나에게 딱 맞는 학원을 더욱 쉽게 찾을 수 있게 교육·학원 서비스를 오픈했습니다. 공부를 하고 싶은데 어디서 시작해야 할지 막막하셨던 분들 모두! 자랑이 교육·학원에서 정보를 제공받을 수 있습니다. 나의 자격을 더욱 빛낼 수 있는 자랑이 교육 학원 서비스 많은 관심과 이용 부탁드립니다.','admin3',to_date('2022-10-21', 'RRRR-MM-DD'),893,2734);
INSERT INTO TBLNOTICEBOARD (NOTICEBOARDSEQ, NOTICEBOARDTITLE, NOTICEBOARDCONTENT, ADMININFOID, NOTICEBOARDWRITEDATE, NOTICEBOARDLIKE, NOTICEBOARDHITS) VALUES (noticeBoardSeq.nextVal,'자랑이 홈페이지 리뉴얼 공지사항','자랑이 홈페이지가 새롭게 리뉴얼 되었습니다. 저희 홈페이지를 방문을 해주신 분들을 위해 보다 다양한 자료와 서비스로 업데이트 하여 누구나 편리하고 쉽게 이용할 수 있도록 접근성을 강화하였습니다. 또한 새로운 디자인과 깔끔한 구성으로 리뉴얼 되었으니 많은 방문 부탁드립니다. 항상 정확하고 신뢰있는 정보와 서비스로 노력하는 자랑이 사이트가 되겠습니다. 감사합니다.','admin4',to_date('2022-10-10', 'RRRR-MM-DD'),970,6567);
INSERT INTO TBLNOTICEBOARD (NOTICEBOARDSEQ, NOTICEBOARDTITLE, NOTICEBOARDCONTENT, ADMININFOID, NOTICEBOARDWRITEDATE, NOTICEBOARDLIKE, NOTICEBOARDHITS) VALUES (noticeBoardSeq.nextVal,'2023년도 국가기술자격검정 변경 사항 공지','2023년도 국가 기술시험에 대한 변경사항이 업데이트되었습니다. [신설자격증] 공간정보융합기능사, 공간정보융합산업기사, 이러닝운영관리사, 한복기능장 [폐지자격증]  한복산업기사, 농림토양평가관리산업기사  변경되는 자격증에 대한 혼동이 없기를 바랍니다. 감사합니다','admin1',to_date('2023-01-01', 'RRRR-MM-DD'),883,2367);
INSERT INTO TBLNOTICEBOARD (NOTICEBOARDSEQ, NOTICEBOARDTITLE, NOTICEBOARDCONTENT, ADMININFOID, NOTICEBOARDWRITEDATE, NOTICEBOARDLIKE, NOTICEBOARDHITS) VALUES (noticeBoardSeq.nextVal,'자랑이 로그인 오류사항 공지','자랑이 페이지에서 일시적으로 나타난 로그인 오류현상으로 인해 긴급 점검 안내입니다.더욱 안정적인 서비스 제공을 위하여 아래와 같이 서버 정기점검이 진행됨을 알려드립니다. 점검 일정 : 2022년 12월 30일 08:00 ~ 10:00까지 불편을 끼쳐 드려 대단히 죄송합니다. 정확하고 편리한 서비스를 위해 노력하겠습니다. 감사합니다.','admin2',to_date('2021-12-30', 'RRRR-MM-DD'),792,3252);
