INSERT INTO tblboard(boardSeq,boardTitle,boardContent,id,boardWriteDate,boardLike,boardReport,boardHits,boardType,isBoardShow) values (boardSeq.NextVal, '네트워크 관리사 시험 후기', '2번의 도전 끝에 드디어 2차 합격 2016년 이패스코리아 손사강의를 통해 이길로 접어든지 언 3년 기나긴 시간들과 한숨 좌절~ 한순간에 반전시키는 합격의 맛! 이 맛에 공부하는 것인가 봅니다.. 40대 중반에 공부가 왠말이냐.. 머리가 굳은게 아니냐..자책 타책~ 이즘에 나도 합격수기를 써봅니다.. 눈치체셨다시피 글쓰는 실력은 없으니 참고바람니다/.. 1. 공부기간 2016년 39회부터 ~41회까지 만3년 1차시험2번 2차시험 3번 한번빼고 시험장소가 신대방사거리역근처 성남중고교.. 3년 년속 시험장에 가다보니 아주 익숙한 장소 추억의 장소가 되어버렸습니다 ', 'bLzCvRqS', '2023-6-21', '232', '0', '118', '2', '1');
