INSERT INTO tblboard(boardSeq,boardTitle,boardContent,id,boardWriteDate,boardLike,boardReport,boardHits,boardType,isBoardShow) values (boardSeq.NextVal, '굴착기 운전기능사 후기', '공부는...어려워요재경관리사와 연달아 준비하면서 비교하자면재경관리사는 시험에 촛점이 맞춰진 느낌이고 (그래서 문제은행식 이라 하죠. 최근 바뀌는 것 같기도) 신용분석사는 실무 이해 중심이라는 느낌이에요 그래서 같은 이론이라도 표현이 상당히 다르고 재경관리사 라는 배경지식이 있기에 처음 이해가 너무 어려웠고 그래서 저는 철저히 기출문제에만 집중 했어요 인강은 듣지 않았고, 토마토패스 교재만 샀는데 해커스 기출과 토마토패스 기출만 봤고 이해 안되는 부분만 따로 이론을 봤어요 기출은...6회분 풀어서 오답노트 정리했습니다', 'hRzCvRmN', '2023-7-3', '2', '0', '121', '2', '1');
