INSERT INTO tblboard(boardSeq,boardTitle,boardContent,id,boardWriteDate,boardLike,boardReport,boardHits,boardType,isBoardShow) values (boardSeq.NextVal, 'ERP 정보 관리사 1급 시험 후기', '공부는...어려워요재경관리사와 연달아 준비하면서 비교하자면재경관리사는 시험에 촛점이 맞춰진 느낌이고 (그래서 문제은행식 이라 하죠. 최근 바뀌는 것 같기도) 신용분석사는 실무 이해 중심이라는 느낌이에요 그래서 같은 이론이라도 표현이 상당히 다르고 재경관리사 라는 배경지식이 있기에 처음 이해가 너무 어려웠고 그래서 저는 철저히 기출문제에만 집중 했어요 인강은 듣지 않았고, 토마토패스 교재만 샀는데 해커스 기출과 토마토패스 기출만 봤고 이해 안되는 부분만 따로 이론을 봤어요 기출은...6회분 풀어서 오답노트 정리했습니다', 'Q4eWnUz', '2023-7-29', '6', '0', '104', '2', '1');
INSERT INTO tblboard(boardSeq,boardTitle,boardContent,id,boardWriteDate,boardLike,boardReport,boardHits,boardType,isBoardShow) values (boardSeq.NextVal, '전산 세무회계 1급 시험 후기', '2월에 졸업을 하고 겨우 서류가 붙어 첫 면접 준비를 하는데 정말 부족한 점이 많다고 느꼈어요. 물론 프론트엔드 관련 지식을 공부하며 느낀 생각이긴 하지만 전공자다 보니 CS 지식도 빠짐없이 복습해야 한다는 생각이 컸습니다.  불합격 메일을 수없이 받으며 포트폴리오와 경험이 너무 부족하다 생각해서 그런지 이거 공부할 시간에 포트폴리오에 넣을 프로젝트나 하나 더 할까..? 하는 생각이 수도 없이 들었습니다.  그렇지만 최근들어 포폴용 프로젝트를 하며 취업에 대한 고민과 우울에 빠져 있는 시간이 많은데 이런 기분을 느낄 새에 기분전환(?) 겸으로 취득하면 어떨까 해서 도전하게 된 정보처리기사였습니다. 😂 그래도 공부하는 내내 4년간 학부에서 배운 내용을 복습하고 심지어 모르는 내용까지 알아갈 수 있어서 너무 뜻깊은 시간이었다고 생각해요. 아직 필기지만!그리고 본 후기는 지극히 전공자의 입장에서 작성한 후기입니다. :)', 'vDzCkNpS', '2023-7-30', '6', '0', '235', '2', '1');
